import React, { useState } from 'react';
import { Calendar, Badge, Card, Row, Col, Typography, Space } from 'antd';
import dayjs from 'dayjs';

const { Title, Text } = Typography;

const FlightAvailabilityCalendar = ({ flightData, currentRoute }) => {
  const [selectedDate, setSelectedDate] = useState(null);

  // Flight class abbreviation to full name
  const classNames = {
    Y: "Economy",
    J: "Business",
    F: "First"
  };

  const dateCellRender = (date) => {
    const dateStr = date.format('YYYY-MM-DD');
    const flights = flightData[dateStr] || [];

    if (flights.length === 0) return null;

    return (
      <div style={{ padding: '2px' }}>
        <Badge 
          count={flights.length} 
          style={{ backgroundColor: '#1890ff' }} 
          overflowCount={99}
        />
        {flights.length <= 2 && (
          <div style={{ fontSize: '10px', marginTop: '2px' }}>
            {flights.map((segment, idx) => (
              <div key={idx} style={{ marginTop: '1px', borderTop: '1px solid #f0f0f0' }}>
                <div>{segment.route}</div>
                <Space size={[2, 2]} wrap>
                  {Object.entries(segment.classes).map(([classCode, available]) => (
                    <Badge 
                      key={classCode}
                      status={available ? "success" : "error"}
                      text={classCode}
                      style={{ fontSize: '10px' }}
                    />
                  ))}
                </Space>
              </div>
            ))}
          </div>
        )}
      </div>
    );
  };

  const onSelect = (date) => {
    setSelectedDate(date.format('YYYY-MM-DD') === selectedDate ? null : date.format('YYYY-MM-DD'));
  };

  return (
    <div>
      <Calendar 
        fullscreen={false}
        dateCellRender={dateCellRender}
        onSelect={onSelect}
        validRange={[dayjs(), dayjs().add(60, 'days')]}
      />

      {selectedDate && flightData[selectedDate] && (
        <Card style={{ marginTop: 16 }}>
          <Title level={4}>Flight Availability for {selectedDate}</Title>
          <Row gutter={[16, 16]}>
            {flightData[selectedDate].map((segment, idx) => (
              <Col key={idx} span={12}>
                <Card size="small">
                  <Title level={5}>{segment.route}</Title>
                  <Space direction="vertical" style={{ width: '100%' }}>
                    {Object.entries(segment.classes).map(([classCode, available]) => (
                      <Space key={classCode}>
                        <Badge status={available ? "success" : "error"} />
                        <Text>
                          <Text strong>{classCode}:</Text> {classNames[classCode]}
                        </Text>
                      </Space>
                    ))}
                  </Space>
                </Card>
              </Col>
            ))}
          </Row>
        </Card>
      )}

      <Card size="small" style={{ marginTop: 16 }}>
        <Title level={5}>Legend</Title>
        <Row gutter={[16, 8]}>
          <Col span={8}>
            <Badge status="success" text="Available" />
          </Col>
          <Col span={8}>
            <Badge status="error" text="Unavailable" />
          </Col>
          <Col span={8}>
            <Text strong>Y:</Text> Economy
          </Col>
          <Col span={8}>
            <Text strong>J:</Text> Business
          </Col>
          <Col span={8}>
            <Text strong>F:</Text> First
          </Col>
        </Row>
      </Card>
    </div>
  );
};

export default FlightAvailabilityCalendar;
